summary.label:
A touchscreen-friendly git client and code editor.
Features
- Git operations:
  - clone, commit, pull, push, file history ...
  - supports github, gitlab, and gitee;
  - various authentication: oAuth, token and SSH key;
  - sync submodules;
- Text editor:
  - Syntax highlighting;
  - auto-complete for Python, javascript/Typescript, HTML;
  - Simple and fast text search;
  - Touchscreen-friendly; 
  - preview html and markdown documents;
- Working together with other apps:
  - Open file system, can be opened in files and other apps;
  - Can open repositories created by other apps as well;
- Able to run code directly in a few programming languages including Python, javascript/typescript;

-- Support code auto completion;
-- Compile, Run Offline C++ (with STL support) Python, and terminal support;
-- Support multiply window and split screen (For iPad);

An IDE for iPad, iPhone devices. Use apple clang compiler to build and run your C/C++ code offline on your device. Also support many language edit, for other language this is a useful auto completion notepad.

Support Languages:
Edit and run: C C++ Python CDBuild(Build System Script) HTML(JavaScript+CSS)
Edit only: CSharp Swift Objective-C Objective-C++ Java
